        .button {
            background-color: #00ffff;
            border: none;
            color: #000;
            padding: 12px 25px;
            text-align: center;
            font-size: 1em;
            margin: 10px;

            cursor: pointer;
            text-decoration: none;
            width: 200px;
            box-shadow: 0 0 15px #00ffff;

        }
        .button:hover {
            background-color: #ff00ff;

        }

            from { text-shadow: 0 0 10px #00ffff; }
            to { text-shadow: 0 0 25px #00ffff; }
        }
        .ticker {
            width: 100%;
            background: linear-gradient(90deg, #00ffff, #ff00ff);
            color: #000;
            padding: 10px 0;
            font-weight: bold;
            overflow: hidden;
            position: fixed;
            bottom: 0;
            z-index: 999;
        }
        .ticker-text {
            display: inline-block;
            white-space: nowrap;
            animation: scroll 15s linear infinite;
        }
        @keyframes scroll {
            0% { transform: translateX(100%); }
            100% { transform: translateX(-100%); }
        }
        footer {
            position: fixed;
            bottom: 40px;
            width: 100%;
            font-size: 0.7em;
            color: #ccc;
